import React, {Component} from 'react';
import logo from './Star_Wars_Logo.svg';
import './style.css';

class App extends Component {

    render(){
        return(
            <div>
                {logo}
                <img src="{logo}" alt=""/>
            </div>
        )
    }

}


export default App;
